import styled from 'styled-components';

export const Container = styled.div`
  .containerHome{
    height: 100vh;
    width: 100%;
    display: flex;
    align-items: center;
    justify-content: center;
    flex-direction: column;
    background-color: #3d6392; 
  }

`;
